import React from "react";
import{Switch, Route} from "react-router-dom"
import Header from "./Header";
import NotFound from "./NotFound";


function Layout() {
  return (
  <>


<div className="container">
  {/* The Header component remains at the top of the page no matter the current route */}
  <Header /> 
    <Switch>
    {/* Route for Home page */}
      <Route>  
        <Home /> 
      </Route>
    {/* Route for study page */}
      <Route >
        <Study />
      </Route>
    {/* Route for Create Deck */}
    <Route >
      <CreateDeck />  
    </Route>
    {/* Route for Deck */}
    <Route >
      <Deck />
    </Route>
    {/* Route for Edit Deck */}
    <Route>
      <EditDeck.js />
    </Route>
    {/* Route for Add Card */}
    <Route>
      <AddCard />
    </Route>
    {/* Route for Edit Card */}
    <Route>
      <EditCard />
    </Route>
    {/* Route for Not Found */}
    <Route>
      <NotFound />
    </Route>
  </Switch>
</div>

  </>
  );
}

export default Layout;
